(7178, 'FinancialInstrument.Primary', 1, 7000, 321, 3, '1', 1, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#	To align with common definitions have prefaced Fis that are not Derivatives as Primary.'),
(7179, 'FinancialInstrument.Primary.Assets', 2, 7178, 833, 3, '1', 1, 2084, 'M', NULL, 1, 'Tx2084', NULL, 1, 'X', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'FinancialAssets', NULL, NULL, NULL, NULL, NULL, NULL, '13ABCE', '#	To align with common definitions in have prefaced Fis that are not Derivatives as Primary. Have therefore also put Derivative on separate level from DerivavtiveAssets and Derivavtive Liabilities.#	To align with common definitions have prefaced Fis that are not Derivatives as Primary.#	There appears a small but possibly significant difference in treatment of CAI between UK GAAP and UK IFRS.#	Both treat CAI as separate from Fair Value through P&L and Held for Trading. Shows in FI heading of Loans and Receivables#	But GAAP gives CAI own row, IFRS shows merged in with Cash and cash equivalents.#	It would seem logical that the assets at Fair Value through P&L (Held for Trading + Initial Recognition) should reconcile back to CAI analsys in various groupings. But even this looks dubious.#	e.g.QuotedEquitySecurities TxId 4122. Is that supposed to equal to UK, Europe and US, be an alternative less detailed Class, or even a catch all for any Exchange that is not UK, Europe or US?#	At present (10/08/2012) have not tried to align CAIs with FI - At Fair Value Through PL, but treated each as discrete granular values. O/S To revise in the future.'),
