(7340, 'FinancialInstrument.Primary.TradeOtherPayables', 2, 7178, 833, 3, '1', 1, 4841, 'M', NULL, 2, 'Tx4841', NULL, 1, 'X', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'TradeOtherPayables', NULL, NULL, NULL, NULL, NULL, NULL, '13ABCE', '#	Cross checking.#	Envisaged that BROS would look to check for accounting completeness and accuracy. But not do all possible logic checks - area for RG#	Included would be arithmetic totals of related areas, or feeding through increasingly summarised informsation to fill values for various TxIds which are essentailly aggregares e.g. Operating Profit#	Qu. 1a Need to work out what is best to do where one set of BROs may be Optional e.g. filling in details of Secured and Unsecured Loans (analysis not needed for Small Companies). In this case cannot set as Master and Slave. There use Check option#	Qu. 1.b But also dangerous to use Check Equal To value. Since one value may be zero. (could only do this if had Zero or Null exception in logic). Problem of having spurious warnings if one set of info optional e.g. not required for say a Small Company.#	Ans. DJH says that this is the default. Default position is that value being checked to does not thow an error if zero. (Logic areas such as Segmentmental analysis may be both optional and zero). So question is the reverse.#	Current problem = force error when you know if one part contains a value, then Checked part must contain also data (and same value of data). Not valid to be zero.#	Options on Secured, Unsecured and Total. Example based on Bank Overdraft#	Import: e.g. SAPA. Map#	- Map NL values 735:739 (Bank Current accounts, if credit balance - only shows < 1yr) to TxId 382. Map NLs 755:764 (Bank Loans <1 yr) and 825:834 (Bank Loans >1yr) to TxId 361.#	- Map Secured (Memo NLs 1751 (<1yr) and Memo NL 1761 (>1yr) to TxId 370 (note SAPA does not separate between Bank Loans and Overdrafts re Ageing or Security).#	#NAME?#	- Options therefore:#	a) Calculate unsecured as difference between total and secured. Fast and logical but what command to do it, removes a possible check#	b) Assume that NL codes go to Unsecured value and then add back the secured. For the 95% that are Small, will not matter. For the 5% that are not they will need to adjust. So not ideal#	Manual posting. Easy, post values to the Unsecured and Secured fields. Make the Total an RO.#	Import or Manual, DJH pits in clever logic that looks to see if Entiy has been ticked as Small on set up and posted to Total value.'),
